import React from 'react';

const Newsletter = () => {
  return (
    <div className="purple container">
      <div className="flex justify-center items-center w-3/4 h-3/4 bg-white shadow-lg rounded-lg">
        <div className="blue container">
          <p className="text-white">Inner Box</p>
        </div>
      </div>
    </div>
  );
};

export default Newsletter;
